How to find a document with an array of strings based on if it has items in common with a reference array of string?<p>Given a reference array of strings: <code>[&quot;Comedy&quot;, &quot;Horror&quot;, &quot;Romance&quot;]</code>,
I would like to query a <code>Movie</code> model with this schema:</p>
<pre><code>const MovieSchema = new Schema({
    _id: {
        type: Types.ObjectId,
        required: true
    },
    title: {
        type: String,
        required: true
    },
    categories: [{ type: String }],
});
</code></pre>
<p>Such that I will get results where I will get <code>Movie</code>s with categories in common with the reference array, sorted by the amount of elements it has in common with the reference array. For example:</p>
<pre><code>[
    {
        _id: &quot;57&quot;,
        title: &quot;Sample Movie A&quot;,
        categories: [&quot;Comedy&quot;, &quot;Horror&quot;, &quot;Romance&quot;, &quot;Family&quot;]
    },
    {
        _id: &quot;92&quot;,
        title: &quot;Sample Movie B&quot;,
        categories: [&quot;Comedy&quot;, &quot;Romance&quot;, &quot;Family&quot;, &quot;Coming of Age&quot;]
    }
]
</code></pre>
<p>Note that Movie A is the first in the results because it has 3 items in common with the reference array while Movie B only has 2 items in common.</p>
<p>How can I achieve this query using Mongoose 5.11.16?</p>

