How to render Array stored in a Object in React?<p>I am trying to develop a discussion forum website using React, Node and MongoDB.In <code>post</code> object, there is nested <code>author</code> object and <code>tags</code> array.
Here is sample image of a <code>post</code> object:
<a href="https://i.stack.imgur.com/RxL0J.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/RxL0J.png" alt="State" /></a></p>
<p>here is the component which I am trying to render:</p>
<pre><code>import React, { Component } from &quot;react&quot;;
import http from &quot;../services/httpService&quot;;
import { postEndPoint, repliesEndPoint } from &quot;../config.json&quot;;

class PostPage extends Component {
  state = {
    post: [],
    replies: [],
  };
  async componentDidMount() {
    const id = this.props.match.params.id;
    const { data: post } = await http.get(postEndPoint + &quot;/&quot; + id);
    const { data: replies } = await http.get(repliesEndPoint + &quot;/&quot; + id);
    console.log(post.tags, typeof post.tags);
    this.setState({ post: post, replies: replies });
  }
  render() {
    const { post, replies } = this.state;
    return (
      &lt;React.Fragment&gt;
        &lt;div className=&quot;container col-lg-8 shadow-lg p-3 mt-5 bg-body rounded&quot;&gt;
          &lt;h2&gt;{post.title}&lt;/h2&gt;
          &lt;p className=&quot;mt-4&quot; style={{ color: &quot;#505050&quot; }}&gt;
            {post.description}
          &lt;/p&gt;
          &lt;div className=&quot;mt-1&quot;&gt;
            Related Topics:
            {post.tags.map((tag) =&gt; (
              &lt;span className=&quot;badge badge-secondary m-1 p-2&quot;&gt;
                {(tag).name}
              &lt;/span&gt;
            ))}
            &lt;h6 className=&quot;mt-2&quot;&gt;
              {post.upvotes.length} Likes {post.views} Views
            &lt;/h6&gt;
            &lt;div class=&quot;d-flex w-100 justify-content-between&quot;&gt;
              &lt;small class=&quot;mb-1&quot;&gt;Posted by {post.author['name']}&lt;/small&gt;
            &lt;/div&gt;
          &lt;/div&gt;
        &lt;/div&gt;
      &lt;/React.Fragment&gt;
    );
  }
}

export default PostPage;
</code></pre>
<p>This throws the following : <code>TypeError: post.tags is undefined</code>. a Similar error is throws while accessing <code>post.upvotes</code> and <code>post.author</code></p>

