Get true or false ( only value not array or object ) from mongodb lookup aggregation<p>I am trying to make a function that returns if a user is a favorite or not.</p>
<p>I am using MongoDB aggregate on User model with lookout with favourites model ( in which all favourite user has saved ) with pipeline and $project</p>
<p>here is the MongoDB aggregate function query</p>
<pre><code>await User.aggregate([
            {
                $match: {
                    _id: ObjectId(_id),
                },
            },
            {
                $lookup: {
                    from: 'userportfolios',
                    localField: '_id',
                    foreignField: 'user',
                    as: 'user_portfolios',
                },
            },
            {
                $lookup: {
                    from: 'favourites',
                    pipeline: [
                        {
                            $match: {
                                user: ObjectId(data.user._id),
                                favourites: {
                                    $elemMatch: {
                                        $eq: ObjectId(_id),
                                    },
                                },
                            },
                        },
                        {
                            $project: {
                                _id: 0,
                                is_favourite: {
                                    $cond: [
                                        { $ifNull: ['$is_favourite', false] },
                                        { $literal: true },
                                        { $literal: false },
                                    ],
                                },
                            },
                        },
                    ],
                    as: 'is_favourite',
                },
            },
        ]);
</code></pre>
