Get documents if one property don't have matches<p>I have a schema on Mongoose something like this:</p>
<pre><code>  const customerSchema = new mongoose.Schema({ name: String, age: Number, email: String });
  const Customer = mongoose.model('Customer', customerSchema);
</code></pre>
<p>And two models like this:</p>
<pre><code>  Customer.create({ name: 'A', age: 30, email: 'a@foo.bar' });
  Customer.create({ name: 'B', age: 28, email: 'b@foo.bar' });
</code></pre>
<p>I want to make a <strong>find()</strong> of <strong>Customers</strong></p>
<p>So if I try something like this:</p>
<pre><code>Customer.find({ age: { $gte: 30 } });
</code></pre>
<p>I'm getting one document (<strong>A</strong>). But whats happend if I send a property who has no match, like this:</p>
<pre><code>Customer.find({ age: { $gte: 30 }, name: 'C' });
</code></pre>
<p><strong>Name</strong> has no matchs so that makes me don't have any document, but I want at least to get the document <strong>A</strong> because <strong>age</strong> matches.</p>
<p>How can I make a <strong>find()</strong> and get all the documents who match any property?</p>
