MongoDB Shema to support concurrent update on a document<p>We were working on a project with a 300 documents with <code>currentValue</code> field in a main collection, in order to track the history of each document of first collection. we created another collection named <code>history</code> with approximately 6.5 millions of documents.
For each input of system we have to add around 30 history item and update <code>currentValue</code> field of main collection, so, We tried computational field design pattern for <code>currentValue</code>, which lead us to have <code>writeConfilict</code> in concurrent situations (at concurrency of around 1000 requests).</p>
<p>Then we tried to compute <code>currentValue</code> field with <code>sum</code> (<code>amount</code> field) and <code>groupBy</code>(<code>mainId</code> field) on history collection  which takes too long (&gt; 3s).</p>
<p>Main collection docs:</p>
<pre class="lang-js prettyprint-override"><code>{
    &quot;_id&quot; : ObjectId(...),
    &quot;stock&quot; : [ 
        {
